import React from 'react';
import './Projects.css'
import Slideshow from './Slideshow'

function Project() {
    return (
        <div>
            <div className="projects-header">
                <h1>Welcome to the Projects page</h1>
            </div>
            <div className="projects-card">
                <Slideshow/>
            </div>
        </div>
    )
}

export default Project
